import React from 'react';

import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

import edit from '../../assets/images/icons/Vector.svg';
import close from '../../assets/images/icons/Delete.svg';

function createData(name, store, address, category, date, price, remains, weight) {
	return { name, store, address, category, date, price, remains, weight };
}

const rows = [
	createData('Sneakers', 'Adidas', 'Krylatskaya st...', 'Sportswear', '05.07.2021', '$1 000', 40, '5kg'),
	createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
	createData('Eclair', 262, 16.0, 24, 6.0),
	createData('Cupcake', 305, 3.7, 67, 4.3),
	createData('Gingerbread', 356, 16.0, 49, 3.9),
];

const ProductTable = () => {
	return (
		<div className="product_table">
			<TableContainer component={Paper}>
				<Table sx={{ minWidth: 700 }} aria-label="customized table">
					<TableHead>
						<TableRow>
							<StyledTableCell>Dessert (100g serving)</StyledTableCell>
							<StyledTableCell align="right">Calories</StyledTableCell>
							<StyledTableCell align="right">Fat&nbsp;(g)</StyledTableCell>
							<StyledTableCell align="right">Carbs&nbsp;(g)</StyledTableCell>
							<StyledTableCell align="right">Protein&nbsp;(g)</StyledTableCell>
						</TableRow>
					</TableHead>
					<TableBody>
						{rows.map((row) => (
							<StyledTableRow key={row.name}>
								<StyledTableCell component="th" scope="row">
									{row.name}
								</StyledTableCell>
								<StyledTableCell align="right">{row.calories}</StyledTableCell>
								<StyledTableCell align="right">{row.fat}</StyledTableCell>
								<StyledTableCell align="right">{row.carbs}</StyledTableCell>
								<StyledTableCell align="right">{row.protein}</StyledTableCell>
							</StyledTableRow>
						))}
					</TableBody>
				</Table>
			</TableContainer>
		</div>
	);
};


// <TableCell align="right">
